import React from 'react';
import PropTypes from 'prop-types';

const AssetAttributesInfo = props => {
  const { Data } = props;
  return (
    <div>
      <p> Attribute details here</p>
    </div>
  );
};

AssetAttributesInfo.propTypes = {
  Data: PropTypes.array.isRequired
};

export default AssetAttributesInfo;
